__NUXT_JSONP__("/svet/mesto/taunggyi", (function(a,b){return {data:[{place:[{id:1437,id_state:b,name:"Taunggyi",population:165120,area:61,altitude:143,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"taunggyi",information_chatgpt:a,image_cover:a,image_hero:a,coordinates:a}],placeState:[{id:b,mpz:"MM",tld:".mm",name:"Myanmar",area:676578,population:54409800,slug:"myanmar",id_continent:3,number_cities:a,information_chatgpt:"\u003Cp\u003EMyanmar (dříve známý jako Barma) je jihovýchodní asijská země s bohatou historií a kulturou. Nachází se mezi Thajskem, Bangladéšem, Indií, Laosu a Čínou a má rozlohu přibližně 676 tisíc kilometrů čtverečních. Hlavním městem je Naypyidaw a největším městem je Yangon.\u003C\u002Fp\u003E\n\u003Cp\u003EMyanmar je domovem mnoha historických památek, včetně slavného chrámu Shwedagon Pagoda, který je považován za nejdůležitější budovu v zemi. Mezi další významné památky patří chrám Ananda Temple v Baganu a mnoho dalších chrámů a klášterů. Země je také známá pro své různorodé etnické skupiny a kulturu, včetně tradičních tanců, řemesel a kuchyně.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě kulturních památek a tradic nabízí Myanmar také úchvatnou přírodu. Země je domovem mnoha národních parků, jako jsou například národní parky Hlawga a Popa Mountain. Tato příroda je také plná vodopádů, jeskyní, řek a hor. Mezi nejvýznamnější přírodní památky patří jezero Inle, kde žijí rybáři na noze a Bagan, oblast plná starobylých chrámů a stúp.\u003C\u002Fp\u003E\n\u003Cp\u003ECestování po Myanmaru může být náročné, zejména mimo města. Nejběžnějším způsobem dopravy je lodí, vlakem nebo autobusem. V zemi jsou také mezinárodní letiště, což usnadňuje přístup pro turisty. Nicméně, země prochází politickými a sociálními problémy, a proto se doporučuje důkladné zvážení cestování do Myanmaru.\u003C\u002Fp\u003E\n\u003Cp\u003EMyanmar je zajímavou a exotickou destinací, nabízející návštěvníkům bohatou historii, kulturu a přírodu. Země je zvláštní svým klidem a mírovou atmosférou, kterou najdete v mnoha oblastech země, a proto může být pro mnoho turistů útočištěm od rychlého tempa moderního světa.\u003C\u002Fp\u003E",image_cover:a,image_hero:a,currency_code:"MMK",currency_name:"kyat",money_prices:a,phone_numbers_emergency:a,phone_prefix:"+95",coordinates:[{latitude:"21.9162",longitude:"95.9560"}],people_religion:a,people_nationality:a,people_education:a,visitors_entry:a}],placeContinent:a}],fetch:{},mutations:void 0}}(null,146)));